def main():
    from openpyxl import load_workbook
    from dataclasses import dataclass
    import random
    import string
    import os
    import openpyxl

    @dataclass()
    class Dimension:
        width: int
        height: int

    def get_all_rows(sheet, dim):
        return [vals for vals in sheet.iter_rows(1, dim.height, 1, dim.width, values_only=True)]

    def get_latest_full_cell(row):
        res = None
        for i, val in enumerate(reversed(row)):
            if val:
                res = len(row) - i
                break
        return res 

    def get_width(rows):
        last_positions = [get_latest_full_cell(row) for row in rows if get_latest_full_cell(row)]
        return max(set(last_positions), key=last_positions.count)

    def get_height(rows):
        return next(len(rows) - i for i, row in enumerate(reversed(rows)) if 'ВСЕГО' in row)

    def xl_copy(from_sheet, from_dim, to_sheet):
        for i in range(1, from_dim.height + 1):
            for j in range(1, from_dim.width + 1):
                cell = from_sheet.cell(row=i, column=j)
                new_cell = to_sheet.cell(row=i, column=j, value=cell.value)

    def find_empty_columns(rows):
        st = next(i + 1 for i, col in enumerate(rows[3]) if col)
        cols = rows[3][st::]
        return [i + 1 for i, col in enumerate(cols, start=st) if not col]

    def remove_empty_cols(sheet, rows):
        empty_cols = find_empty_columns(rows)
        for i, col_idx in enumerate(empty_cols):
            sheet.delete_cols(col_idx - i, 1)

    def get_new_name():
        return ''.join(random.choices(string.ascii_lowercase + string.digits, k=6))

    fname = r'C:\Users\robot.ad\PycharmProjects\formirovanie_osv\sverka\test.xlsx'
    workbook = load_workbook(filename=fname, data_only=True)
    default_sheet = workbook.worksheets[0]

    raw_dimension = Dimension(default_sheet.max_column, default_sheet.max_row)
    rows = get_all_rows(default_sheet, raw_dimension)

    new_dimension = Dimension(get_width(rows), get_height(rows))
    rows = [row[0:new_dimension.width] for row in rows[:new_dimension.height]]

    x = get_new_name()
    new_fname = rf'C:\Users\robot.ad\PycharmProjects\formirovanie_osv\sverka\{x}.xlsx'
    with open(new_fname, 'w'):
        pass
    new_workbook = openpyxl.Workbook()
    new_sheet = new_workbook.worksheets[0]

    xl_copy(default_sheet, new_dimension, new_sheet)
    remove_empty_cols(new_sheet, rows)

    new_workbook.save(filename=rf'C:\Temp\{x}.xlsx')

    return rf'{x}.xlsx'

__return__ = main()
